import React, { useContext } from "react";
import { Global } from "../context/context";

function TeamComponent() {
  const [Oldstate] = useContext(Global);
  return (
    <div>
      <h3>welcome Mr {Oldstate}</h3>
    </div>
  );
}

export default TeamComponent;
